// src/App.js
import { GoogleOAuthProvider } from '@react-oauth/google'; // ✅ import this
// ... your other imports

function App() {
  return (
    <GoogleOAuthProvider clientId="1056083452714-ngbiuq08o73dilcp7ku6ib2j6fb2naac.apps.googleusercontent.com"> {/* ✅ wrap here */}
      <AuthProvider>
        <Router>
          <Navbar />
          <Routes>
            <Route path="/" element={<Home />} />
            <Route
              path="/add-customer"
              element={
                <PrivateRoute>
                  <AddCustomer />
                </PrivateRoute>
              }
            />
            <Route
              path="/add-order"
              element={
                <PrivateRoute>
                  <AddOrder />
                </PrivateRoute>
              }
            />
            <Route
              path="/create"
              element={
                <PrivateRoute>
                  <CreateCampaign />
                </PrivateRoute>
              }
            />
            <Route
              path="/campaigns"
              element={
                <PrivateRoute>
                  <Campaigns />
                </PrivateRoute>
              }
            />
            <Route path="/login" element={<LoginWithGoogle />} />
          </Routes>
        </Router>
      </AuthProvider>
    </GoogleOAuthProvider> // 
  );
}
